import React from 'react'

const Navbar = ({name, setAuthentication}) => {
    const logout = (e) => {
        e.preventDefault();
        setAuthentication(false);
    }
    return (
        <div>
            <h1>{name}</h1>
            <button onClick={logout}/>
        </div>
    )
}

export default Navbar
